import React, { useState } from 'react';
import { dummyProfiles } from '../../data/profiles';

const ExploreScreen = () => {
  const [activeCategory, setActiveCategory] = useState('all');
  const [followedProfiles, setFollowedProfiles] = useState(new Set());

  const categories = [
    { id: 'all', label: 'All' },
    { id: 'artists', label: 'Artists' },
    { id: 'venues', label: 'Venues' },
    { id: 'promoters', label: 'Promoters' },
    { id: 'agents', label: 'Agents' }
  ];

  const getFilteredProfiles = () => {
    if (activeCategory === 'all') return dummyProfiles;

    const roleMap = {
      'artists': 'ARTIST',
      'venues': 'VENUE',
      'promoters': 'PROMOTER',
      'agents': 'AGENT'
    };

    return dummyProfiles.filter(profile => profile.role === roleMap[activeCategory]);
  };

  const filteredProfiles = getFilteredProfiles();

  const handleFollow = (profileId) => {
    const newFollowed = new Set(followedProfiles);
    if (newFollowed.has(profileId)) {
      newFollowed.delete(profileId);
    } else {
      newFollowed.add(profileId);
    }
    setFollowedProfiles(newFollowed);
  };

  return (
    <div className="screen active explore-screen">
      <div className="explore-header">
        <h2>Discover</h2>
        <div className="category-tabs">
          {categories.map(cat => (
            <button
              key={cat.id}
              className={`category-tab ${activeCategory === cat.id ? 'active' : ''}`}
              onClick={() => setActiveCategory(cat.id)}
            >
              {cat.label}
            </button>
          ))}
        </div>
      </div>

      <div className="explore-grid">
        {filteredProfiles.map(profile => (
          <div key={profile.id} className="explore-card">
            <div className="explore-card-header">
              <img 
                src={profile.avatar} 
                alt={profile.name} 
                className="explore-avatar"
              />
              {profile.isVerified && (
                <span className="verified-badge">âœ“</span>
              )}
            </div>

            <div className="explore-card-content">
              <h3>{profile.name}</h3>
              <span className={`role-badge ${profile.role.toLowerCase()}`}>
                {profile.role}
              </span>
              <p className="location">{profile.location}</p>

              {profile.genres && profile.genres.length > 0 && (
                <div className="genre-tags">
                  {profile.genres.slice(0, 3).map(genre => (
                    <span key={genre} className="genre-tag">{genre}</span>
                  ))}
                </div>
              )}

              <p className="bio">{profile.bio}</p>

              {profile.capacity && (
                <div className="venue-info">
                  <span>Capacity: {profile.capacity}</span>
                </div>
              )}

              <div className="profile-stats">
                {profile.followers && (
                  <span>{profile.followers.toLocaleString()} followers</span>
                )}
                {profile.connections && (
                  <span>{profile.connections} connections</span>
                )}
              </div>

              <div className="explore-card-actions">
                <button 
                  className={`btn ${followedProfiles.has(profile.id) ? 'btn-outline' : 'btn-primary'}`}
                  onClick={() => handleFollow(profile.id)}
                >
                  {followedProfiles.has(profile.id) ? 'Following' : 'Follow'}
                </button>
                <button className="btn btn-outline">View Profile</button>
              </div>
            </div>
          </div>
        ))}
      </div>

      {filteredProfiles.length === 0 && (
        <div className="empty-state">
          <p>No {activeCategory === 'all' ? 'profiles' : activeCategory} found</p>
        </div>
      )}
    </div>
  );
};

export default ExploreScreen;
